                var html_79740e364a0f6f35ad649a52099f17d9 = $(`<div id="html_79740e364a0f6f35ad649a52099f17d9" style="width: 100.0%; height: 100.0%;"><h3>Don't stop... belaying</h3><p>Rating: ★★⯪</p><p>FA: Aaron “The Batman” Geistfeld and Adam Schenk February 2022</p><p>Description: Journey would tell you to don’t stop….. believing in how much fun this slab route is.  It’s a laid back tech climb that makes you wish it keeps going.  There’s 2 cruxes in the route that make you commit your feet to the cause.  Start the route by clipping the first clip off the big rock (literally stick clip without the stick) and then work the crack to the right and then commit over to the next bolt once you get above the first bolt then begin the fun climbs.</p></div>`)[0];

                var html_5619fbab6ddef05155e04481eaabcfc8 = $(`<div id="html_5619fbab6ddef05155e04481eaabcfc8" style="width: 100.0%; height: 100.0%;"><h3>Pretty high for a climb guy</h3><p>Rating: ★★</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p>Description: And all the tourists’ say Pretty High for a Climb Guy but make sure you take Offspring’s word and climb this route.  Start the route going between the flake on the right and slab on the left.  Press up into the crack……aretish climb and show your technical skills cause your muscles won’t do much on this route.  With a tight bolting setup through the large crack, you feel confident that you got through the crux but now cross onto the main rock and continue your way through the crimp slab.  Finally you see the end in sight, a long fun out of 5.5 to the anchors.  Clip in and turn around…. Enjoy the beautiful view facing the eastern canyon towards Las Vegas.  Beware the rope drag if you choose to top rope.</p></div>`)[0];
                popup_26c6f5eb19a19202b0fce6b1a1f20aab.setContent(html_5619fbab6ddef05155e04481eaabcfc8);

                var html_a49cfdbf3fe8d551eb3f1111462d9715 = $(`<div id="html_a49cfdbf3fe8d551eb3f1111462d9715" style="width: 100.0%; height: 100.0%;"><h3>Bolt Climb Rock Fall</h3><p>Rating: ★★★</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p>Description: Bob Seger will tell you this route will help soothe the soul with all the different styles rolled into it.  It shares the same first bolt with Climbing on Broken Choss.  After you get up to the second bolt, you run into the crux but you are able to clip before committing into the crux and deciding how you want to tackle it from there.  Once through the crux you get some slab climbing and a nice rest before going into the face climb which is the cherry of the route.  You have a a combination of crack, hueco (body sized), knee bar and lastly plates that you get to use to work your way up to the anchors.  Once through, you get one more little slab and to the anchors. Oh and like Broken Choss, you wonder if the holds are gonna break but they are durable for some odd reason.  Enjoy the rush and different styles and make your way up this route that will help you reminisce about the most important part to climbing…… fun.</p></div>`)[0];

                var html_05571c74e0973988787626b51a2740eb = $(`<div id="html_05571c74e0973988787626b51a2740eb" style="width: 100.0%; height: 100.0%;"><h3>Routebusters</h3><p>Rating: ★★⯪</p><p>FA: Aaron “The Batman” Geistfeld</p><p>Description: Ray Parker Jr is gonna call you to solve this route.  Work your way up the shallow huecos/pockets.  Enjoy the knee bar and then before you realize it, the crux is there and figuring it out may need to go back into the kneebar to relax.  Find the hold that will get you over the crux and then work your way up to the anchors. Join the routebusters crew and say…. I ain’t afraid of no holds!</p></div>`)[0];

                var html_f003286b11d6ed4625915271b2ee7ec3 = $(`<div id="html_f003286b11d6ed4625915271b2ee7ec3" style="width: 100.0%; height: 100.0%;"><h3>Chips and Salsa</h3><p>Rating: ★★</p><p>FA: Unknown</p><p>Description: What can I say? At 5.3 most will think this trivial and in fact it is well suited for a solo, date climb or neophyte first lead. But as 5.3 routes go, it really is a pretty nice climb. Locate the prominent cleft that that bisects the Tuna and Chips Wall. Tuna & Chips goes up the left side of the wall and Tuna Cookies the right. Chips and Salsa starts behind a large block at the bottom of the cleft at a low angle crack. Waterstreak goes up the obvious polished feature to the right. Face climb up the nicely featured rock along the crack to a belay where it opens into a wide chimney. There are two bolts and a drilled angle piton for an anchor, and then two more bolts and chains for Waterstreak, a little to the right.  For P2, wander up easier - and certainly less exposed - climbing in the chimney to the top. This is mostly scrambling and not much actual chimney technique is necessary. Descend to the climbers right and down a gully.</p></div>`)[0];

                var html_789d1271a3f3b10e2172cc99946f5376 = $(`<div id="html_789d1271a3f3b10e2172cc99946f5376" style="width: 100.0%; height: 100.0%;"><h3>Physical Graffiti</h3><p>Rating: ★★★</p><p>FA: Martinet, Grandstaff, Gordon '73</p><p>Description: Physical Graffiti is an excellent crack climb for the beginning leader. Start near the left side of the Riding Hood Wall at the steep crack with big jugs around it. P1) Climb up the featured corner, passing a small roof, to a two-bolt anchor. 30 meters. (5.6) P2) Climb up and right into the crack (small gear), and jam it until the angle eases. Then run it out on easy terrain up and left to a two-bolt anchor. 60 meters. (5.6) Descent: Scramble left, then down the third class gully. Alternatively, rap off the west face, then downclimb the gully (tricky).</p></div>`)[0];

                var html_9bbfe22a7041c91e729f8002d9fe39c9 = $(`<div id="html_9bbfe22a7041c91e729f8002d9fe39c9" style="width: 100.0%; height: 100.0%;"><h3>Big Bad Wolf</h3><p>Rating: ★★★</p><p>FA: L. Gallia, E. Allen, D. Young</p><p>Description: Big Bad Wolf is a 4 pitch sport route 30 ft left of Physical Graffiti with the black hangers. Scramble up the gully that leads to Riding Hood for about 20 ft. The route starts on a flat sloping rock (which slid down the gully about 5 ft in Oct 2015 during really heavy rains). P1 – 5.9, 8 b’s, 70 ft, for the most part is a jug haul on vertical desert varnish, 2 chained anchors. P2 – 5.8, 8 b’s, 80 ft, Red Rock slab climbing with a thin crux midway, 2 chained anchors. P3 – 5.8, 8 b’s, 70 ft, the slab soon turns vertical with more large holds to the finish, 2 chained anchors. P4 - 5.0, 2 b's w 2 bolt anchor, no rappel rings, 30 ft, mini-pitchette for those wanting to walk off climbers left and safely get to the walk off ledge. Look up and right for the 1st bolt. Pitch is shaped like a crescent moon up and right. Anchor is directly above P3 chains. Pitches 1 & 2 or 2 & 3 can be combined with a 60m rope and 17 draws, or combine all 3 pitches with a 70m rope and 26 draws. Descent Options: Preferred Descent: Walk off climbers left: climb P4 to arrive at the walk-off ledge, being very careful with all of the loose rock on the ledges. Continue south east (climbers left) until you see the gully with the tree in it and descend. Rapping the route as you climbed it frequently leads to stuck ropes and isn't recommended. Or scramble right to the standard Physical Graffiti rappel and gully walk off.</p></div>`)[0];

                var html_6fcab1fb37eebf3a21e10e922adfa29c = $(`<div id="html_6fcab1fb37eebf3a21e10e922adfa29c" style="width: 100.0%; height: 100.0%;"><h3>Physical Graffiti</h3><p>Rating: ★★★</p><p>FA: Martinet, Grandstaff, Gordon '73</p><p>Description: Physical Graffiti is an excellent crack climb for the beginning leader. Start near the left side of the Riding Hood Wall at the steep crack with big jugs around it. P1) Climb up the featured corner, passing a small roof, to a two-bolt anchor. 30 meters. (5.6) P2) Climb up and right into the crack (small gear), and jam it until the angle eases. Then run it out on easy terrain up and left to a two-bolt anchor. 60 meters. (5.6) Descent: Scramble left, then down the third class gully. Alternatively, rap off the west face, then downclimb the gully (tricky).</p></div>`)[0];

                var html_c4ebc0b6675adc097a82295a1fd78eac = $(`<div id="html_c4ebc0b6675adc097a82295a1fd78eac" style="width: 100.0%; height: 100.0%;"><h3>Big Bad Wolf</h3><p>Rating: ★★★</p><p>FA: L. Gallia, E. Allen, D. Young</p><p>Description: Big Bad Wolf is a 4 pitch sport route 30 ft left of Physical Graffiti with the black hangers. Scramble up the gully that leads to Riding Hood for about 20 ft. The route starts on a flat sloping rock (which slid down the gully about 5 ft in Oct 2015 during really heavy rains). P1 – 5.9, 8 b’s, 70 ft, for the most part is a jug haul on vertical desert varnish, 2 chained anchors. P2 – 5.8, 8 b’s, 80 ft, Red Rock slab climbing with a thin crux midway, 2 chained anchors. P3 – 5.8, 8 b’s, 70 ft, the slab soon turns vertical with more large holds to the finish, 2 chained anchors. P4 - 5.0, 2 b's w 2 bolt anchor, no rappel rings, 30 ft, mini-pitchette for those wanting to walk off climbers left and safely get to the walk off ledge. Look up and right for the 1st bolt. Pitch is shaped like a crescent moon up and right. Anchor is directly above P3 chains. Pitches 1 & 2 or 2 & 3 can be combined with a 60m rope and 17 draws, or combine all 3 pitches with a 70m rope and 26 draws. Descent Options: Preferred Descent: Walk off climbers left: climb P4 to arrive at the walk-off ledge, being very careful with all of the loose rock on the ledges. Continue south east (climbers left) until you see the gully with the tree in it and descend. Rapping the route as you climbed it frequently leads to stuck ropes and isn't recommended. Or scramble right to the standard Physical Graffiti rappel and gully walk off.</p></div>`)[0];

                var html_d769970c617775b4e2ab46b5eb285a20 = $(`<div id="html_d769970c617775b4e2ab46b5eb285a20" style="width: 100.0%; height: 100.0%;"><h3>Pretty high for a climb guy</h3><p>Rating: ★★</p><p>Sport: 95 ft (29 m)</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p>Description: And all the tourists’ say Pretty High for a Climb Guy but make sure you take Offspring’s word and climb this route.  Start the route going between the flake on the right and slab on the left.  Press up into the crack……aretish climb and show your technical skills cause your muscles won’t do much on this route.  With a tight bolting setup through the large crack, you feel confident that you got through the crux but now cross onto the main rock and continue your way through the crimp slab.  Finally you see the end in sight, a long fun out of 5.5 to the anchors.  Clip in and turn around…. Enjoy the beautiful view facing the eastern canyon towards Las Vegas.  Beware the rope drag if you choose to top rope.</p></div>`)[0];

                var html_bb0eecf7272a10c6d0131a25d8cfafcf = $(`<div id="html_bb0eecf7272a10c6d0131a25d8cfafcf" style="width: 100.0%; height: 100.0%;"><h3>Bolt Climb Rock Fall</h3><p>Rating: ★★★</p><p>Sport: 85 ft (26 m)</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p>Description: Bob Seger will tell you this route will help soothe the soul with all the different styles rolled into it.  It shares the same first bolt with Climbing on Broken Choss.  After you get up to the second bolt, you run into the crux but you are able to clip before committing into the crux and deciding how you want to tackle it from there.  Once through the crux you get some slab climbing and a nice rest before going into the face climb which is the cherry of the route.  You have a a combination of crack, hueco (body sized), knee bar and lastly plates that you get to use to work your way up to the anchors.  Once through, you get one more little slab and to the anchors. Oh and like Broken Choss, you wonder if the holds are gonna break but they are durable for some odd reason.  Enjoy the rush and different styles and make your way up this route that will help you reminisce about the most important part to climbing…… fun.</p></div>`)[0];

                var html_6649b145ed258b6952ade5f7daef1b8f = $(`<div id="html_6649b145ed258b6952ade5f7daef1b8f" style="width: 100.0%; height: 100.0%;"><h3>Big Bad Wolf</h3><p>Rating: ★★★</p><p>Sport, 220 ft (67 m), 3 pitches</p><p>FA: L. Gallia, E. Allen, D. Young</p><p>Description: Big Bad Wolf is a 4 pitch sport route 30 ft left of Physical Graffiti with the black hangers. Scramble up the gully that leads to Riding Hood for about 20 ft. The route starts on a flat sloping rock (which slid down the gully about 5 ft in Oct 2015 during really heavy rains). P1 – 5.9, 8 b’s, 70 ft, for the most part is a jug haul on vertical desert varnish, 2 chained anchors. P2 – 5.8, 8 b’s, 80 ft, Red Rock slab climbing with a thin crux midway, 2 chained anchors. P3 – 5.8, 8 b’s, 70 ft, the slab soon turns vertical with more large holds to the finish, 2 chained anchors. P4 - 5.0, 2 b's w 2 bolt anchor, no rappel rings, 30 ft, mini-pitchette for those wanting to walk off climbers left and safely get to the walk off ledge. Look up and right for the 1st bolt. Pitch is shaped like a crescent moon up and right. Anchor is directly above P3 chains. Pitches 1 & 2 or 2 & 3 can be combined with a 60m rope and 17 draws, or combine all 3 pitches with a 70m rope and 26 draws. Descent Options: Preferred Descent: Walk off climbers left: climb P4 to arrive at the walk-off ledge, being very careful with all of the loose rock on the ledges. Continue south east (climbers left) until you see the gully with the tree in it and descend. Rapping the route as you climbed it frequently leads to stuck ropes and isn't recommended. Or scramble right to the standard Physical Graffiti rappel and gully walk off.</p></div>`)[0];

                var html_8e279590834ed1d53a4c52c8eaf68d48 = $(`<div id="html_8e279590834ed1d53a4c52c8eaf68d48" style="width: 100.0%; height: 100.0%;"><h3>Pretty high for a climb guy</h3><p>YDS: 5.8+</p><p>Rating: ★★</p><p>Sport: 95 ft (29 m)</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p>Description: And all the tourists’ say Pretty High for a Climb Guy but make sure you take Offspring’s word and climb this route.  Start the route going between the flake on the right and slab on the left.  Press up into the crack……aretish climb and show your technical skills cause your muscles won’t do much on this route.  With a tight bolting setup through the large crack, you feel confident that you got through the crux but now cross onto the main rock and continue your way through the crimp slab.  Finally you see the end in sight, a long fun out of 5.5 to the anchors.  Clip in and turn around…. Enjoy the beautiful view facing the eastern canyon towards Las Vegas.  Beware the rope drag if you choose to top rope.</p></div>`)[0];

                var html_e6cced3985a2bd7b968cd76c6cfb0e80 = $(`<div id="html_e6cced3985a2bd7b968cd76c6cfb0e80" style="width: 100.0%; height: 100.0%;"><h3>Bolt Climb Rock Fall</h3><p>YDS: 5.10b/c</p><p>Rating: ★★★</p><p>Sport: 85 ft (26 m)</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p>Description: Bob Seger will tell you this route will help soothe the soul with all the different styles rolled into it.  It shares the same first bolt with Climbing on Broken Choss.  After you get up to the second bolt, you run into the crux but you are able to clip before committing into the crux and deciding how you want to tackle it from there.  Once through the crux you get some slab climbing and a nice rest before going into the face climb which is the cherry of the route.  You have a a combination of crack, hueco (body sized), knee bar and lastly plates that you get to use to work your way up to the anchors.  Once through, you get one more little slab and to the anchors. Oh and like Broken Choss, you wonder if the holds are gonna break but they are durable for some odd reason.  Enjoy the rush and different styles and make your way up this route that will help you reminisce about the most important part to climbing…… fun.</p></div>`)[0];

                var html_cf9c4b06956c2951217575fecb7ae29a = $(`<div id="html_cf9c4b06956c2951217575fecb7ae29a" style="width: 100.0%; height: 100.0%;"><h3>Routebusters</h3><p>YDS: 5.10a</p><p>Rating: ★★⯪</p><p>Sport: 55 ft (17 m)</p><p>FA: Aaron “The Batman” Geistfeld</p><p>Description: Ray Parker Jr is gonna call you to solve this route.  Work your way up the shallow huecos/pockets.  Enjoy the knee bar and then before you realize it, the crux is there and figuring it out may need to go back into the kneebar to relax.  Find the hold that will get you over the crux and then work your way up to the anchors. Join the routebusters crew and say…. I ain’t afraid of no holds!</p></div>`)[0];

                var html_20f806d0fd428f7f47c75071307b38f8 = $(`<div id="html_20f806d0fd428f7f47c75071307b38f8" style="width: 100.0%; height: 100.0%;"><h3>Dirty Clings Done Dirt Cheap</h3><p>YDS: 5.10a</p><p>Rating: ★★⯪</p><p>Sport: 45 ft (14 m)</p><p>FA: Aaron “The Batman” Geistfeld February 2022</p><p>Description: AC/DC might do dirty things but they never did this route to enjoy the dirty clings.  Enjoy the sweet climb through the large huecos.  The moves are amazing but the holds are a little sandy (yes I cleaned them as much as possible but more climbing will help).  Once you get through the 5.9 climbing huecos (stop at the last one and take a rest in it), you hit the crux of tech climbing.  Don’t worry, if you blow the move, the bolt is almost at your waist so you don’t have much of a fall.  Since this route is new, a helmet is suggested since there are some loose rocks still that someone will somehow find and pull off even if we cleaned off everything we think is around the path. </p></div>`)[0];

                var html_2d361ac153540960eea4f534bc06c8ff = $(`<div id="html_2d361ac153540960eea4f534bc06c8ff" style="width: 100.0%; height: 100.0%;"><h3>Climbing on a prayer</h3><p>YDS: 5.10a</p><p>Rating: ★★</p><p>Sport: 60 ft (18m)</p><p>FA: Aaron “The Batman” Geistfeld February 2022</p><p>Description: If you are a fan of letting people watch you climb a crimpy route that really doesn’t let up, then this the route.  Bon Jovi will tell you that Gina told Tommy to hold on to what they got on this route.  You are engaged the entire way up with small hand holds giving you some rest but not letting up on the hands.  Work your way from an amazing start at the first bolt up the crimp ladder til you hit the last bolt where it eases up and you clip into the anchors at the top.</p></div>`)[0];

                var html_d33f2b93d620f62520a8bdba09fa9142 = $(`<div id="html_d33f2b93d620f62520a8bdba09fa9142" style="width: 100.0%; height: 100.0%;"><h3>Chips and Salsa</h3><p>YDS: 5.3</p><p>Rating: ★★</p><p>Trad, 250 ft (76 m), 2 pitches</p><p>FA: Unknown</p><p>Description: What can I say? At 5.3 most will think this trivial and in fact it is well suited for a solo, date climb or neophyte first lead. But as 5.3 routes go, it really is a pretty nice climb. Locate the prominent cleft that that bisects the Tuna and Chips Wall. Tuna & Chips goes up the left side of the wall and Tuna Cookies the right. Chips and Salsa starts behind a large block at the bottom of the cleft at a low angle crack. Waterstreak goes up the obvious polished feature to the right. Face climb up the nicely featured rock along the crack to a belay where it opens into a wide chimney. There are two bolts and a drilled angle piton for an anchor, and then two more bolts and chains for Waterstreak, a little to the right.  For P2, wander up easier - and certainly less exposed - climbing in the chimney to the top. This is mostly scrambling and not much actual chimney technique is necessary. Descend to the climbers right and down a gully.</p></div>`)[0];

                var html_e43d445867ec4b879ce602044d20bf06 = $(`<div id="html_e43d445867ec4b879ce602044d20bf06" style="width: 100.0%; height: 100.0%;"><h3>Physical Graffiti</h3><p>YDS: 5.6</p><p>Rating: ★★★</p><p>Trad, 250 ft (76 m), 2 pitches</p><p>FA: Martinet, Grandstaff, Gordon '73</p><p>Description: Physical Graffiti is an excellent crack climb for the beginning leader. Start near the left side of the Riding Hood Wall at the steep crack with big jugs around it. P1) Climb up the featured corner, passing a small roof, to a two-bolt anchor. 30 meters. (5.6) P2) Climb up and right into the crack (small gear), and jam it until the angle eases. Then run it out on easy terrain up and left to a two-bolt anchor. 60 meters. (5.6) Descent: Scramble left, then down the third class gully. Alternatively, rap off the west face, then downclimb the gully (tricky).</p></div>`)[0];

                var html_f6540d15f9e7338416172843feedabab = $(`<div id="html_f6540d15f9e7338416172843feedabab" style="width: 100.0%; height: 100.0%;"><h3>Don't stop... belaying</h3><p>YDS: 5.9</p><p>Rating: ★★⯪</p><p>Sport: 85 ft (26 m)</p><p>FA: Aaron “The Batman” Geistfeld and Adam Schenk February 2022</p><p> MTN PRJ Description: Journey would tell you to don’t stop….. believing in how much fun this slab route is.  It’s a laid back tech climb that makes you wish it keeps going.  There’s 2 cruxes in the route that make you commit your feet to the cause.  Start the route by clipping the first clip off the big rock (literally stick clip without the stick) and then work the crack to the right and then commit over to the next bolt once you get above the first bolt then begin the fun climbs.</p></div>`)[0];

                var html_8ab9fa1e56e04cb9ee1b2338e93ca180 = $(`<div id="html_8ab9fa1e56e04cb9ee1b2338e93ca180" style="width: 100.0%; height: 100.0%;"><h3>Pretty high for a climb guy</h3><p>YDS: 5.8+</p><p>Rating: ★★</p><p>Sport: 95 ft (29 m)</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p> MTN PRJ Description: And all the tourists’ say Pretty High for a Climb Guy but make sure you take Offspring’s word and climb this route.  Start the route going between the flake on the right and slab on the left.  Press up into the crack……aretish climb and show your technical skills cause your muscles won’t do much on this route.  With a tight bolting setup through the large crack, you feel confident that you got through the crux but now cross onto the main rock and continue your way through the crimp slab.  Finally you see the end in sight, a long fun out of 5.5 to the anchors.  Clip in and turn around…. Enjoy the beautiful view facing the eastern canyon towards Las Vegas.  Beware the rope drag if you choose to top rope.</p></div>`)[0];

                var html_4c2018c68dbc31d0c440a57ec5b4eb23 = $(`<div id="html_4c2018c68dbc31d0c440a57ec5b4eb23" style="width: 100.0%; height: 100.0%;"><h3>Bolt Climb Rock Fall</h3><p>YDS: 5.10b/c</p><p>Rating: ★★★</p><p>Sport: 85 ft (26 m)</p><p>FA: Aaron “The Batman” Geistfeld, Julia Parrot and Katie Johnson</p><p> MTN PRJ Description: Bob Seger will tell you this route will help soothe the soul with all the different styles rolled into it.  It shares the same first bolt with Climbing on Broken Choss.  After you get up to the second bolt, you run into the crux but you are able to clip before committing into the crux and deciding how you want to tackle it from there.  Once through the crux you get some slab climbing and a nice rest before going into the face climb which is the cherry of the route.  You have a a combination of crack, hueco (body sized), knee bar and lastly plates that you get to use to work your way up to the anchors.  Once through, you get one more little slab and to the anchors. Oh and like Broken Choss, you wonder if the holds are gonna break but they are durable for some odd reason.  Enjoy the rush and different styles and make your way up this route that will help you reminisce about the most important part to climbing…… fun.</p></div>`)[0];

                var html_77fd9895b2f8cf47adbd9d6b863f6acc = $(`<div id="html_77fd9895b2f8cf47adbd9d6b863f6acc" style="width: 100.0%; height: 100.0%;"><h3>Dirty Clings Done Dirt Cheap</h3><p>YDS: 5.10a</p><p>Rating: ★★⯪</p><p>Sport: 45 ft (14 m)</p><p>FA: Aaron “The Batman” Geistfeld February 2022</p><p> MTN PRJ Description: AC/DC might do dirty things but they never did this route to enjoy the dirty clings.  Enjoy the sweet climb through the large huecos.  The moves are amazing but the holds are a little sandy (yes I cleaned them as much as possible but more climbing will help).  Once you get through the 5.9 climbing huecos (stop at the last one and take a rest in it), you hit the crux of tech climbing.  Don’t worry, if you blow the move, the bolt is almost at your waist so you don’t have much of a fall.  Since this route is new, a helmet is suggested since there are some loose rocks still that someone will somehow find and pull off even if we cleaned off everything we think is around the path. </p></div>`)[0];

                var html_481429f7878b342a49518950b07aa267 = $(`<div id="html_481429f7878b342a49518950b07aa267" style="width: 100.0%; height: 100.0%;"><h3>Climbing on a prayer</h3><p>YDS: 5.10a</p><p>Rating: ★★</p><p>Sport: 60 ft (18m)</p><p>FA: Aaron “The Batman” Geistfeld February 2022</p><p> MTN PRJ Description: If you are a fan of letting people watch you climb a crimpy route that really doesn’t let up, then this the route.  Bon Jovi will tell you that Gina told Tommy to hold on to what they got on this route.  You are engaged the entire way up with small hand holds giving you some rest but not letting up on the hands.  Work your way from an amazing start at the first bolt up the crimp ladder til you hit the last bolt where it eases up and you clip into the anchors at the top.</p></div>`)[0];

                var html_5dbcd2e245e7b90c244a2d28010dd49c = $(`<div id="html_5dbcd2e245e7b90c244a2d28010dd49c" style="width: 100.0%; height: 100.0%;"><h3>Chips and Salsa</h3><p>YDS: 5.3</p><p>Rating: ★★</p><p>Trad, 250 ft (76 m), 2 pitches</p><p>FA: Unknown</p><p> MTN PRJ Description: What can I say? At 5.3 most will think this trivial and in fact it is well suited for a solo, date climb or neophyte first lead. But as 5.3 routes go, it really is a pretty nice climb. Locate the prominent cleft that that bisects the Tuna and Chips Wall. Tuna & Chips goes up the left side of the wall and Tuna Cookies the right. Chips and Salsa starts behind a large block at the bottom of the cleft at a low angle crack. Waterstreak goes up the obvious polished feature to the right. Face climb up the nicely featured rock along the crack to a belay where it opens into a wide chimney. There are two bolts and a drilled angle piton for an anchor, and then two more bolts and chains for Waterstreak, a little to the right.  For P2, wander up easier - and certainly less exposed - climbing in the chimney to the top. This is mostly scrambling and not much actual chimney technique is necessary. Descend to the climbers right and down a gully.</p></div>`)[0];

                var html_5dffa4fa232428f50f251d76cc6791a1 = $(`<div id="html_5dffa4fa232428f50f251d76cc6791a1" style="width: 100.0%; height: 100.0%;"><h3>Physical Graffiti</h3><p>YDS: 5.6</p><p>Rating: ★★★</p><p>Trad, 250 ft (76 m), 2 pitches</p><p>FA: Martinet, Grandstaff, Gordon '73</p><p> MTN PRJ Description: Physical Graffiti is an excellent crack climb for the beginning leader. Start near the left side of the Riding Hood Wall at the steep crack with big jugs around it. P1) Climb up the featured corner, passing a small roof, to a two-bolt anchor. 30 meters. (5.6) P2) Climb up and right into the crack (small gear), and jam it until the angle eases. Then run it out on easy terrain up and left to a two-bolt anchor. 60 meters. (5.6) Descent: Scramble left, then down the third class gully. Alternatively, rap off the west face, then downclimb the gully (tricky).</p></div>`)[0];

                var html_4a685bc8f2b72442385bcce86e3d24b0 = $(`<div id="html_4a685bc8f2b72442385bcce86e3d24b0" style="width: 100.0%; height: 100.0%;"><h3>Big Bad Wolf</h3><p>YDS: 5.9</p><p>Rating: ★★★</p><p>Sport, 220 ft (67 m), 3 pitches</p><p>FA: L. Gallia, E. Allen, D. Young</p><p> MTN PRJ Description: Big Bad Wolf is a 4 pitch sport route 30 ft left of Physical Graffiti with the black hangers. Scramble up the gully that leads to Riding Hood for about 20 ft. The route starts on a flat sloping rock (which slid down the gully about 5 ft in Oct 2015 during really heavy rains). P1 – 5.9, 8 b’s, 70 ft, for the most part is a jug haul on vertical desert varnish, 2 chained anchors. P2 – 5.8, 8 b’s, 80 ft, Red Rock slab climbing with a thin crux midway, 2 chained anchors. P3 – 5.8, 8 b’s, 70 ft, the slab soon turns vertical with more large holds to the finish, 2 chained anchors. P4 - 5.0, 2 b's w 2 bolt anchor, no rappel rings, 30 ft, mini-pitchette for those wanting to walk off climbers left and safely get to the walk off ledge. Look up and right for the 1st bolt. Pitch is shaped like a crescent moon up and right. Anchor is directly above P3 chains. Pitches 1 & 2 or 2 & 3 can be combined with a 60m rope and 17 draws, or combine all 3 pitches with a 70m rope and 26 draws. Descent Options: Preferred Descent: Walk off climbers left: climb P4 to arrive at the walk-off ledge, being very careful with all of the loose rock on the ledges. Continue south east (climbers left) until you see the gully with the tree in it and descend. Rapping the route as you climbed it frequently leads to stuck ropes and isn't recommended. Or scramble right to the standard Physical Graffiti rappel and gully walk off.</p></div>`)[0];
